import React from 'react';
import styled from 'styled-components';
import Search from './search/Search';



const Container = styled.div`
display:flex;
margin-top: 2rem;
width:93%;
align-self:center;
height:100%;
background-color:white;
`;

const TransactionsDisplay = () => {
    return (
        <Container>
            <Search/>
        </Container>
    );
};

export default TransactionsDisplay;
